const $menu = $("#sidenavify");
$(".sidenav-btn").append(
  '<i class="fas fa-angle-right endify rotate-icon"></i>'
),
  $(document).ready(function () {
    $("#sidenav-toggler").click(function () {
      var e = 280 == $menu.width() ? "0" : "280px";
      $menu.animate({ width: e }, "200");
    });
  }),
  $(document).ready(function () {
    $(".sidenav-item > a.sidenav-btn").on("click", function () {
      $(this).hasClass("active")
        ? ($(this).removeClass("active"),
          $(this).siblings(".sidenav-collapse").slideUp(200),
          $(".sidenav-item > a.sidenav-btn i.rotate-icon")
            .removeClass("down")
            .addClass("up"))
        : ($(".sidenav-item > a.sidenav-btn i.rotate-icon")
            .removeClass("down")
            .addClass("up"),
          $(this).find("i").removeClass("up").addClass("down"),
          $(".sidenav-item > a.sidenav-btn").removeClass("active"),
          $(this).addClass("active"),
          $(".sidenav-collapse").slideUp(200),
          $(this).siblings(".sidenav-collapse").slideDown(200));
    });
  }),
  $(document).mouseup((e) => {
    $menu.is(e.target) ||
      0 !== $menu.has(e.target).length ||
      $menu.animate({ width: "0px" });
  });
